import React from "react";
import classes from "./headMenu.module.scss";
import AngleDown from "../../trifles/icons/AngleDown";
import AngleBtn from "../../trifles/AngleBtn";

const headMenu = () => {
  const categories = [
    "Bakery",
    "Fruits and vegetables",
    "Meat and Fish",
    "Drinks",
    "Kitchen",
    "Special nutrition",
    "Baby",
    "Pharmacy",
  ];

  return (
    <div className={classes.headMenu}>
      {categories.map((item) => (
        <AngleBtn>{item}</AngleBtn>
      ))}
    </div>
  );
};

export default headMenu;
